CREATE TABLE IF NOT EXISTS account_activity (
    `account_activity_action` VARCHAR(25) CHARACTER SET utf8,
    `account_activity_timestamp` INT,
    `account_activity_ip_address` VARCHAR(39) CHARACTER SET utf8,
    `account_activity_user_agent` VARCHAR(287) CHARACTER SET utf8,
    `account_activity_datr_cookie` VARCHAR(24) CHARACTER SET utf8,
    `account_activity_city` VARCHAR(13) CHARACTER SET utf8,
    `account_activity_region` VARCHAR(10) CHARACTER SET utf8,
    `account_activity_country` VARCHAR(2) CHARACTER SET utf8,
    `account_activity_site_name` VARCHAR(16) CHARACTER SET utf8
);
